import React from "react";
import styles from "./studyCard.module.css";

const StudyCardOnline = () => {
  //const { name, type, summary, startDay, current, max } = props;
  return (
    <div className={styles.studyCard}>
      <div className={styles.detail}>
        <div>
          <p className={styles.name}>영어회화 스터디</p>
          <p className={styles.type.online}>온라인</p>
        </div>
        <p className={styles.summary}></p>
        <div>
          첫 스터디<p className={styles.startDay}></p>
          <p className={styles.env}>/</p>
        </div>
      </div>
    </div>
  );
};

export default StudyCardOnline;
